        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Le domaine de la logistique a eu son origine dans les forces militaires des empires romain et 
                    byzantin. Logistique nécessite aujourd'hui de bonnes compétences organisationnelles, la capacité de 
                    raisonnement rapide et un excellent esprit d'analyse. Il existe de nombreux sous-domaines à l'étude de 
                    la logistique, dont les principaux sont la logistique militaire, la logistique des entreprises, la 
                    gestion d'entrepôt et de logistique d'urgence.
   ");
            WriteLiteral(@"             </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    La formation de Management des Transports et de la logistique prépare à l'exercice des fonctions de 
                    Management des activités des Transports des entreprises industrielles, de négoce et de distribution, 
                    ainsi que chez les prestataires en Transports et Logistiques au niveau national et international.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Le Master Management des transports et de la Logistique forme des collaborateurs de haut niveau 
                    capables de concevoir, gérer");
            WriteLiteral(@" et contrôler les activités très diverses liées au processus logistique 
                    et à la maîtrise de la Supply Chain. Cette formation apporte à des étudiants d’origines diverses, un 
                    complément spécifique à l’ensemble des disciplines économiques, commerciales, de gestion, 
                    de technologies modernes et d’ingénierie appliquées à la logistique et au Supply Chain Management.
                </p>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le Master de Spécialisation en Transport et Logistique s’adresse à des étudiants et des professionnels, issus tant 
                    des pays en développement que des pays européens, soucieux de développer ou de compléter leurs connaissances des questions 
                    de transport et de logistique. 
                    Au terme de la formation, l’étudiant sera capable d’élaborer un projet ou une politique de trans");
            WriteLiteral(@"port selon quatre piliers.
                </p>
                <ul class=""one_list"">
                    <li> 
                        En ayant une vision critique, autonome et responsable des questions qu’il traite
                    </li>
                    <li> 
                        Selon une approche pluridisciplinaire
                     </li>
                    <li> 
                        En reconnaissant les spécificités de chaque contexte
                    </li>
                    <li> 
                        En tenant compte des impacts environnementaux, économiques et sociaux à court et long termes
                    </li>
                </ul>
            </div>

